import React from 'react'
import { useHistory } from 'react-router-dom';
import { Button } from 'antd'


export default function login(props) {

    const onClick = () => {
        props.history.push('/jobManagemen')
    }
    return (
        <>
            <Button onClick={onClick}>login</Button>
        </>

    )
}
